-- FIRST OF ALL CREATE TABLE IN YOUR DATABASE
DROP TABLE IF EXISTS cs621week2_parking;

CREATE TABLE cs621week2_parking (
    entryid integer NOT NULL,
    floor text NOT NULL,
    entry timestamp without time zone NOT NULL,
    exit timestamp without time zone NOT NULL,
    registration text NOT NULL
);


ALTER TABLE ONLY cs621week2_parking
    ADD CONSTRAINT cs621week2_parking_pkey PRIMARY KEY (entryid);

-- EXAMPLE 1

-- Q1: Use date_part() to return all cars who entered the car park on the 6th of January 2018
SELECT * from CS621Week2_Parking where (date_part('day',entry) = 6);

-- Q2: Use date_part() to return all cars who exited the car park on any day on or after the 12th January 2018 (inclusive)
SELECT * from CS621Week2_Parking where (date_part('day',exit) >= 12) order by exit asc;

--Q3: Write a query to return all cars who exited on or after 9pm (regardless of day) and who parked on Basement floor?
select * from cs621week2_parking where date_part('hour',exit)>=21 and floor = 'Basement';

-- Q4: Write a query to return all cars with registration plate starting and ending with number 9. Which car is the most recently exited?
select * from cs621week2_parking where (registration ~ '^9.*9$') order by exit desc LIMIT 1;

-- Q5: How many cars have registrations which begin and end with two 8 digits [regardless of any other digit]? Which car entered the airport first (or earliest)?
select * from cs621week2_parking where (registration ~ '^88.*88$') order by entry asc LIMIT 1;

-- Q6: How many cars used the car park with registration plates where the first alphabetic character is ‘E’?
select count(*) from cs621week2_parking where (registration ~ '^.*-E.*-.*$');

-- Q7: How many cars have reg plates ending with exactly 5 digit numbers with last digit 7?
select * from cs621week2_parking where (registration ~ '^.*-.*-[0-9]{4}7$');

-- Q8: Find all cars parked who parked in the Basement and have a 3 digit or 4 digit number in the last block of registration
select * from cs621week2_parking where (registration ~ '^.*-.*-[0-9]{3,4}$') and floor = 'Basement';

-- Q9: (Tricky). Find all cars parked on FloorE with at least 2 digit 8 together anywhere at the end of registration
select * from cs621week2_parking where (registration ~ '^.*-.*-.*8{2,}.*$') and floor = 'FloorE';

-- Q10: Find all rows in the table where the sum of the hour and minute of entry is greater than sum of hour and minute of exit
select * from cs621week2_parking where  (date_part('hour',entry) + date_part('minute',entry) > @date_part('hour',exit) + date_part('minute',exit));
 
-- Q11: Display all parking which happened on Floors ending with a capital letter vowel character?
 select * from cs621week2_parking where (floor ~ '^.*(A|E|I|O|U)$')
 
-- Q12: Write a query to return all registrations where the reg has structure 3 digits, 3 upper case, 3 digits (remember the hyphens)
 select * from cs621week2_parking where (registration ~ '^\d{3}-[A-Z]{3}-\d{3}$');

